import React from 'react'
import ExpenseItem from './ExpenseItem'

const ExpenseList = (pro) => {
    let expenseContent = <p style={{ color: "red" }}>No expense found</p>

    if (props.value.length > 0) {
        expenseContent = props.value.map((index, id) => {
            return <ExpenseItem title={index.title} amount={index.amount} date={index.date} key={id}></ExpenseItem>
        })
    }
    return (
        <div>
            <expenseContent />
        </div>
    )
}

export default ExpenseList
